    </div>
  </div>

  <div class="column">
    <div class="card">
      <h3>{fd}</h3>
      <p>first dose</p>
    </div>
  </div>
  <button onClick={showToast}> click me</button>
  <div class="column">
    <div class="card">
      <h3>{bd}</h3>
      <p>both doses</p>
    </div>
  </div>


  <div class="column">
    <div class="card">
      <h3>{nbd}</h3>
      <p>not vaccinated yet</p>
    </div>
  </div>
</div>

</div>
